import React from 'react';

const Home = () => {
  return (
    <>
      <div className='container-fluid'>
        <div className='row'>
          <div className='col-10 mx-auto'>
            <div className='col-6 hero_text'>
              <h1>Welcome to my site</h1>
              <br />
              <h1>Hello this is Ritam Rahman</h1>
              <button className='btn btn-success'> Check Now</button>
            </div>
            <div className='col-6 hero_img'>
              <img src='../images/hero.svg' />
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Home;
